  render() {
    return (
      <React.Fragment>


        <div className="grid">
          <header>
            <Header></Header>
          </header>

          <aside className="sidebar-left">
            <Sidebar></Sidebar>
          </aside>

          <article>

          </article>

          <aside>
            <RightSidebar></RightSidebar>
          </aside>

          <footer>
            <Footer></Footer>
          </footer>
        </div>



      </React.Fragment>
    );
  }
}

export default TermsAndConditions;
